    [TestFixture]
    class TestHeap
    {
        [Test]
        public void TestBuildheap()
        {
            int[] array = new[] {16,4,10,14,7,9,3,2,8,1,25};
            HeapAlgorithmns obj = new HeapAlgorithmns(array);
            obj.BuildHeap();
            Assert.That(obj.list.First(), Is.EqualTo(25));
            obj.HeapSort();
            Assert.That(obj.list, Is.Ordered);
        }


        [Test]
        public void TestQuickSort()
        {
            int[] array = new[] { 7,6,5,4,3,2,1};
            QuickSort obj = new QuickSort(array);
            obj.Sort(0,array.Length-1);
            Console.WriteLine(obj.comparisons);
            Assert.That(obj.Array, Is.Ordered);
        }


